<?php

namespace Database\Factories;

use Illuminate\Database\Eloquent\Factories\Factory;

/**
 * @extends \Illuminate\Database\Eloquent\Factories\Factory<\App\Models\Kegiatan>
 */
class KegiatanFactory extends Factory
{
    protected $model = \App\Models\Kegiatan::class;
    /**
     * Define the model's default state.
     *
     * @return array<string, mixed>
     */
    public function definition(): array
    {
        return [
            'nama' => fake()->sentence(),
            'deskripsi' => fake()->paragraph(),
            // set tanggal to random date between 2023-01-01 and 2023-12-31
            'tanggal' => fake()->dateTimeBetween('2023-01-01', '2023-12-31'),
            'tempat' => "Banjarmasin",
            'content' => fake()->paragraphs(8, true),
            'slug' => fake()->slug(),
            'foto' => "",
        ];
    }
}
